define({"topics" : [{"title":"Installation","shortdesc":"\n            <p class=\"shortdesc\">You can install <span class=\"ph\">Data Collector</span> and start it     manually or run it as a service. \n            </p>\n         ","id":"concept_gbn_4lv_1r","href":"datacollector\/UserGuide\/Installation\/InstallationAndConfig.html#concept_gbn_4lv_1r","menu": {"hasChildren":true,},"tocID":"concept_gbn_4lv_1r-d46e3898","next":"concept_gbn_4lv_1r-d46e3898",},{"title":"Full Installation and Launch (Manual Start)","shortdesc":"\n            <p class=\"shortdesc\"></p>\n         ","id":"task_bt1_zcp_kq","href":"datacollector\/UserGuide\/Installation\/Installing_the_DC.html#task_bt1_zcp_kq","menu": {"hasChildren":false,},"tocID":"task_bt1_zcp_kq-d46e4132","topics":[]},{"title":"Full Installation and Launch (Service Start)","id":"concept_e45_3dr_bx","href":"datacollector\/UserGuide\/Installation\/FullInstall_ServiceStart.html#concept_e45_3dr_bx","menu": {"hasChildren":true,},"tocID":"concept_e45_3dr_bx-d46e4156","next":"concept_e45_3dr_bx-d46e4156",},{"title":"Core Installation","shortdesc":"\n            <p class=\"shortdesc\">You can download and install a core version of <span class=\"ph\">Data Collector</span>, and         then install individual stage libraries as needed. Use the core installation to install only         the stage\n               libraries that you want to use. The core installation allows <span class=\"ph\">Data Collector</span> to use         less disk space.\n            </p>\n         ","id":"concept_vvw_p3m_s5","href":"datacollector\/UserGuide\/Installation\/CoreInstall_Overview.html#concept_vvw_p3m_s5","menu": {"hasChildren":true,},"tocID":"concept_vvw_p3m_s5-d46e4328","next":"concept_vvw_p3m_s5-d46e4328",},{"title":"Install Additional Stage Libraries","id":"concept_fb2_qmn_bz","href":"datacollector\/UserGuide\/Installation\/AddtionalStageLibs.html#concept_fb2_qmn_bz","menu": {"hasChildren":true,},"tocID":"concept_fb2_qmn_bz-d46e4448","next":"concept_fb2_qmn_bz-d46e4448",},{"title":"Installation with Cloudera Manager","id":"concept_nb5_c3m_25","href":"datacollector\/UserGuide\/Installation\/CMInstall-Overview.html#concept_nb5_c3m_25","menu": {"hasChildren":true,},"tocID":"concept_nb5_c3m_25-d46e4730","next":"concept_nb5_c3m_25-d46e4730",},{"title":"Run Data Collector from Docker","shortdesc":"\n            <p class=\"shortdesc\"></p>\n         ","id":"concept_jxh_qxr_kv","href":"datacollector\/UserGuide\/Installation\/Installing_the_DC-Docker.html#concept_jxh_qxr_kv","menu": {"hasChildren":false,},"tocID":"concept_jxh_qxr_kv-d46e5022","topics":[]},{"title":"Installation with Cloud Service Providers","shortdesc":"\n            <p class=\"shortdesc\">You can install the full <span class=\"ph\">Data Collector</span> using         cloud service providers such as Microsoft Azure or Microsoft Azure HDInsight. When you         install <span class=\"ph\">Data Collector</span>         using a cloud service provider, you install <span class=\"ph\">Data Collector</span> as a         service. \n            </p>\n         ","id":"concept_dsp_5j2_wdb","href":"datacollector\/UserGuide\/Installation\/CloudInstall.html#concept_dsp_5j2_wdb","menu": {"hasChildren":true,},"tocID":"concept_dsp_5j2_wdb-d46e5046","next":"concept_dsp_5j2_wdb-d46e5046",},{"title":"MapR Prerequisites","shortdesc":"\n            <p class=\"shortdesc\">Due to licensing restrictions, StreamSets cannot distribute MapR libraries with <span class=\"ph\">Data Collector</span>. As a         result, you must perform additional steps to enable the <span class=\"ph\">Data Collector</span>         machine to connect to MapR. <span class=\"ph\">Data Collector</span> does         not display MapR origins and destinations in stage library lists nor the MapR Streams         statistics aggregator\n               in the pipeline properties until you perform these         prerequisites.\n            </p>\n         ","id":"concept_jgs_qpg_2v","href":"datacollector\/UserGuide\/Installation\/MapR-Prerequisites.html#concept_jgs_qpg_2v","menu": {"hasChildren":true,},"tocID":"concept_jgs_qpg_2v-d46e5211","next":"concept_jgs_qpg_2v-d46e5211",},{"title":"Creating Another Data Collector Instance","shortdesc":"\n            <p class=\"shortdesc\"></p>\n         ","id":"concept_p2w_x3z_yx","href":"datacollector\/UserGuide\/Installation\/CreateAnotherDC.html#concept_p2w_x3z_yx","menu": {"hasChildren":false,},"tocID":"concept_p2w_x3z_yx-d46e5707","topics":[]},{"title":"Uninstallation","id":"concept_fc3_vly_py","href":"datacollector\/UserGuide\/Installation\/Uninstall.html#concept_fc3_vly_py","menu": {"hasChildren":true,},"tocID":"concept_fc3_vly_py-d46e5732","next":"concept_fc3_vly_py-d46e5732",}]});